var first = document.body.firstChild;
isShowShareHeaderBack = typeof(isShowShareHeaderBack) != 'undefined' ? isShowShareHeaderBack : false;
showHeaderMeeting = typeof(showHeaderMeeting) != 'undefined' ? showHeaderMeeting : false;
isShowSearch = typeof(isShowSearch) != 'undefined' ? isShowSearch : false;
isShowIndex = typeof(isShowIndex) != 'undefined' ? isShowIndex : false;
moduleNumber = typeof(moduleNumber) != 'undefined' ? moduleNumber : 1; //1会议通知2微课堂
isShowMeetingIndex = typeof(isShowMeetingIndex) != 'undefined' ? isShowMeetingIndex : false;
isShowMylive = typeof(isShowMylive) != 'undefined' ? isShowMylive : false;

// 判断是否登录
var _user = commonMessage();
$(document).ready(function() {
    if (is_weixn() || is_mqqbrowser() || (!/(iPhone|iPad|iPod|iOS|Android)/i.test(navigator.userAgent))) {
        $('body').prepend('<div id="shareHeader"><div class="header_left"><img style="display:' + (isShowShareHeaderBack ? "inline-block" : "none") + '" class="back" src="data:image/png;base64,"><img class="logo" src="data:image/png;base64,"></div><div class="search" style="display:' + (isShowSearch ? "flex" : "none") + '"><img src="data:image/png;base64,">搜索</div><div class="header_right"><img class="download" src="data:image/png;base64,"><div class="more"><img src="data:image/png;base64," ></div></div><ul class="drop_down"><li class="drop_down_item my" style="color:#000;display:' + (showHeaderMeeting ? '' : 'none') + '"><img src="data:image/png;base64," >我的会议</li><li class="drop_down_item meetingIndex" style="display:' + (isShowMeetingIndex ? "flex" : "none") + '"><img src="data:image/png;base64,">全部会议</li><li class="drop_down_item myLive" style="display:' + (isShowMylive ? "flex" : "none") + '"><img src="data:image/png;base64,">我的直播</li><li class="drop_down_item home" style="display:' + (isShowIndex ? "flex" : "none") + '"><img src="data:image/png;base64," >' + (moduleNumber == 1 ? "会议通知" : moduleNumber == 2 ? "微课堂" : "") + '首页</li><li class="drop_down_item register"><img src="data:image/png;base64," >注册登录</li><li class="drop_down_item logout"><img src="data:image/png;base64,">切换账号</li></ul></div>');
    }
    if (_user) {
        if (_user.userid) {
            $('.drop_down .logout').css('display', 'flex');
        } else {
            $('.drop_down .register').css('display', 'flex');
        }
    }
    // 默认返回
    $('#shareHeader .back').on('click', function() {
        console.log(history)
        if(getUrlParam('back')=='1'){
            window.history.go(-2);
        }else{
            window.history.go(-1);
        }
        // document.location.href = document.referrer;
    });

    $('.header .back').on('click', function() {
        console.log(history)
        window.history.go(-1);
        // document.location.href = document.referrer;
    });
    // header显示下拉
    $('#shareHeader .more').on('click', function() {
        if ($('.drop_down').css('display') == 'none') {
            $('.drop_down').show();
        } else {
            $('.drop_down').hide();
        }
    });
    $('.header .more').on('click', function() {
        if ($('.drop_down').css('display') == 'none') {
            $('.drop_down').show();
        } else {
            $('.drop_down').hide();
        }
    });
    // 退出
    $('#shareHeader .drop_down .logout').on('click', function() {
        delCookie("g_userid");
        msg("退出成功");
        setTimeout(function() {
            // alert(getShareVersion() + "login/login.html?backurl=" + location.href)
            window.location.href = getShareVersion() + "login/login.html?backurl=" + location.href;
        }, 1000)
    });
    $('.header .drop_down .logout').on('click', function() {
        delCookie("g_userid");
        msg("退出成功");
        setTimeout(function() {
            window.location.href = getShareVersion() + "login/login.html?backurl=" + location.href;
        }, 1000)
    });
    $('#shareHeader .drop_down .my').on('click', function() {
        window.location.href = getShareVersion() + 'meetingNotice/myMeeting.html'
    });
    $('#shareHeader .drop_down .meetingIndex').on('click', function() {
        window.location.href = getShareVersion() + 'meetingNotice/meetingIndex.html'
    });
    $('#shareHeader .drop_down .myLive').on('click', function() {
        window.location.href = getShareVersion() + 'live/myLive.html'
    });
    $(".home").on('click', function() {
        if (moduleNumber == 1) {
            window.location.href = getShareVersion() + 'meetingNotice/meetingIndex.html'
        } else {
            window.location.href = getShareVersion() + 'microClassShare/microClassIndex.html'
        }
    });
    // 注册
    $('#shareHeader .drop_down .register').on('click', function() {
        window.location.href = getShareVersion() + "login/login.html?backurl=" + location.href;
    });
    $('.header .drop_down .register').on('click', function() {
        window.location.href = getShareVersion() + "login/login.html?backurl=" + location.href;
    });
    // 下载
    $('#shareHeader .download').on('click', function() {
        window.location.href = getShareVersion() +'share/download_app.html'

    });
    $('.header .download').on('click', function() {
        window.location.href = getShareVersion() +'share/download_app.html'
    });
});

function msg(str) {
    layer.open({
        content: str,
        skin: 'msg',
        anim: 'scale',
        time: 1 //2秒后自动关闭
    });
}